import piperSketch from "../../../illustrations/piper-sketch.png";
import angel from "../../../illustrations/angel.png";

let galleryArr = [
    {src: piperSketch, alt: "Sketch"},
    {src: angel, alt: "Angel"} ];

export default galleryArr;
